window.bookSummaryJSON = "<p>Merlin’s final words haunt the Sentinel’s dreams.</p> <p>Kellan’s eidetic memory replays them with perfect clarity each night since he breached the guff and withdrew three human souls. Now, more than a year later, both he and his Soulborn wife are visited by an entity who channeled Universal power to enter our world from another.</p> <p>This Emissary of Destruction provides the young Sentinel with a gift of unimaginable power and a dire warning. This combination sets Kellan on a journey which takes him to the land of Fae. There he must gain support from the Fairy King and Queen.</p> <p>Unfortunately, all Fae extract a price commensurate with the help they provide, and Kellan is no exception.</p> <p>The royals send him to confront historic evils and tragedy in return for empowering the emissary’s gift. As well laid plans built by Mantels, gods, and other immortals hurtle toward their conclusion only one element could not have been anticipated.</p> <p>What would the Sentinel of Order do to honor departed friends and protect those who remain? Kellan has risked his life many times for those he loves. Is he now also willing to accept, a burden of chaos....</p>"; 
